import React, { useState } from "react";
import "./OneOnOneSessions.css";

const OneOnOneSessions = () => {
  const [selectedSession, setSelectedSession] = useState(null);

  const counselors = [
    { id: 1, name: "Dr. Jane Smith", specialization: "Anxiety", price: "$50/session" },
    { id: 2, name: "Dr. Robert Johnson", specialization: "Depression", price: "$60/session" },
    { id: 3, name: "Dr. Emily Davis", specialization: "Stress Management", price: "$55/session" },
    { id: 4, name: "Dr. Michael Brown", specialization: "Trauma", price: "$70/session" },
    { id: 5, name: "Dr. Sarah Wilson", specialization: "Self-Esteem", price: "$50/session" },
  ];

  const handleBookNow = (session) => {
    setSelectedSession(session);
    alert(`You selected a session with ${session.name}. Proceeding to payment...`);
    // Here you can integrate a payment gateway (e.g., Razorpay, Stripe, PayPal)
  };

  return (
    <div className="one-on-one-container">
      <header className="one-on-one-header">
        <h1>One-on-One Sessions</h1>
        <p>Choose a counselor for a personalized session</p>
      </header>
      <div className="counselors-grid">
        {counselors.map((counselor) => (
          <div className="counselor-card" key={counselor.id}>
            <h3>{counselor.name}</h3>
            <p>Specialization: {counselor.specialization}</p>
            <p>Price: {counselor.price}</p>
            <button
              className="book-now-button"
              onClick={() => handleBookNow(counselor)}
            >
              Book Now
            </button>
          </div>
        ))}
      </div>
      {selectedSession && (
        <div className="payment-container">
          <h3>Proceed to Payment for {selectedSession.name}</h3>
          <p>Specialization: {selectedSession.specialization}</p>
          <p>Price: {selectedSession.price}</p>
          <button className="proceed-button">Proceed to Payment</button>
        </div>
      )}
    </div>
  );
};

export default OneOnOneSessions;
